import React from 'react'

const Contador = () => {
  return (
    <nav className='d-flex justify-content-center'>
      <button className='btn btn-primary mx-1'> + </button>
      <button className='btn btn-secondary mx-1'> +5 </button>
      <button className='btn btn-success mx-1'> 0 </button>
      <button className='btn btn-warning mx-1'> - </button>
      <button className='btn btn-danger mx-1'> -5 </button>
    </nav>
  )
}

export default Contador
